import React, { Component } from "react";
import "./AddItems.css";
class AddItems extends Component {
  render() {
    return (
      <div>
        <form>
          <input
            type="text"
            placeholder="Enter Name..."
            id="name"
            onClick={this.handleChange}
          />
          <input
            type="text"
            placeholder="Enter Age..."
            id="age"
            onClick={this.handleChange}
          />
          <input type/>
        </form>
      </div>
    );
  }
}
export default AddItems;
